export default function PimpMyTerminal() {
	const articleInAnimation = {
		animate: {
			opacity: [0, 1],
			y: [200, 0],
		},
		transition: {
			duration: 1,
			delay: 0.75,
			ease: "easeOut",
			times: [0, 1],
		},
	};
	const asideInAnimation = {
		initial: {
			x: -300,
			width: 0,
		},
		animate: {
			x: [-300, 0, 0],
			width: [300, 400, 300],
			scaleY: [1, 0.9, 1],
		},
		transition: {
			duration: 0.6,
			delay: 1.5,
			ease: "easeInOut",
			times: [0, 0.5, 1],
		},
	};

	const { scrollY } = useViewportScroll();
	const asideY = useSpring(scrollY, { stiffness: 400, damping: 20 });

	return (
		<div>
			<Grid container direction="column" justify="center" alignItems="center">
				<Hero className="logo" />
			</Grid>
			<motion.div {...articleInAnimation}>
				<ArticleView
					source="events/pimp-my-terminal/pimp-my-terminal.md"
					title="Pimp My Terminal"
				/>
			</motion.div>
			<motion.aside className="quick-links" {...asideInAnimation} y={asideY}>
				<h3>Quick Links</h3>
				<Button to="/bash-cheatsheet">Bash Cheatsheet</Button>
				<Button to="/powershell-cheatsheet">Powershell Cheatsheet</Button>
			</motion.aside>
		</div>
	);
}

